import { EnthusiasmAction } from '../actions';
import { INCREMENT_ENTHUSIASM,INCREMENT_ENTHUSIASM_FINISH } from '../constants';
//import { Demo } from '../components/Hello';
//import initState from '../store/initState';

function demoStore(state: object[] = [],action:EnthusiasmAction) : object{
    switch (action.type){
        case INCREMENT_ENTHUSIASM:
            return state
        case INCREMENT_ENTHUSIASM_FINISH:
            return action.demoStore
        default:
            return state
    }
}

const AppReducer = {
    demoStore
}

export default AppReducer
